import "../node_modules/bootstrap/dist/css/bootstrap.min.css";

import './index.css'
const App = () =>{
    return(<>
        <section>
            <div className = "conatainer">
                <div className ="row">
                    <div className ="col-10">
                        <h1>Welcome to CovidInfo</h1>
                    
                    </div>
                </div>
            </div>
        </section>

    </>);
}

export default App;
